//SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

interface IERC20 {
    function totalSupply() external view returns (uint);

    function balanceOf(address account) external view returns (uint);

    function transfer(address recipient, uint amount) external returns (bool success);

    function allowance(address owner, address spender) external view returns (uint);

    function approve(address spender, uint amount) external returns (bool success);

    function transferFrom(
        address sender,
        address recipient,
        uint amount
    ) external returns (bool success);

    event Transfer(address indexed from, address indexed to, uint value);
    event Approval(address indexed owner, address indexed spender, uint value);
}

//Actual contract
contract TinoToken is IERC20 {
    string public symbol;
    string public name;
    uint8 public decimals;
    uint public _totalSupply;

    mapping (address => uint) balances;
    mapping (address => mapping (address => uint)) allowed;

    constructor() {
        symbol = "TIN";
        name = "TinoToken";
        decimals = 18;
        _totalSupply= 1_000_001_000_000_000_000_000_000;
        balances[0x7684BaFF5117a57BA2eF7039b5627Bce72f38De4] = _totalSupply;
        emit Transfer(address(0), 0x7684BaFF5117a57BA2eF7039b5627Bce72f38De4, _totalSupply);
    }

    function totalSupply() external view returns (uint) {
        return _totalSupply - balances[address(0)];
    }

    function balanceOf(address account) external view returns (uint) {
        return balances[account];
    }

    function transfer(address recipient, uint amount) external returns (bool success) {
        balances[msg.sender] = balances[msg.sender] - amount;
        balances[recipient] = balances[recipient] + amount;
        emit Transfer(msg.sender, recipient, amount);
        return true;
    }

    function approve(address spender, uint amount) external returns (bool success) {
        allowed[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint amount) external returns (bool success) {
        balances[sender] = balances[sender] - amount;
        allowed[sender][msg.sender] = allowed[sender][msg.sender] - amount;
        balances[recipient] = balances[recipient] + amount;
        emit Transfer(sender, recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) external view returns (uint) {
        return allowed[owner][spender];
    }
}
